  "text" : "\uB098\uB3C4 \uC9C0\uB3C4\uAD50\uC218\uB2D8\uC758 \uC5F0\uAD6C\uC870\uAD50\uB85C \uADFC\uBB34\uD560 \uB54C, \uC9C8\uBCD1 \uAE30\uD0C0 \uBD80\uB4DD\uC774\uD55C \uC0AC\uC720\uB85C \uC778\uD55C \uCD94\uAC00\uC2DC\uD5D8\uC744 \uC694\uAD6C\uD558\uBA74\uC11C \uC81C\uCD9C\uD558\uB294 \uC99D\uBE59\uC11C\uB958 \uB9CE\uC774 \uBC1B\uC544 \uBD04. \uC785\uC6D0\uC99D\uB3C4 \uC788\uC5C8\uACE0, \uCD9C\uC0B0\uB3C4 \uC788\uC5C8\uACE0, \uBD80\uBAA8 \uB4F1 \uAC00\uC871\uC758 \uC0AC\uB9DD\uC99D\uBA85\uC11C\uB3C4 \uC788\uC5C8\uACE0.. \uCD94\uAC00\uC2DC\uD5D8\uC774 \uBD88\uAC00\uB2A5\uD55C \uAC83\uC740 \uC5C6\uACE0, \uAD50\uC218\uB2D8 \uD558\uAE30 \uB098\uB984",
