  "text" : "\uC778\uC815\uB418\uB354\uB77C\uB3C4, \uAC01\uAC01\uC758 \uAD6C\uC18D\uC0AC\uC720\uC5D0 \uD574\uB2F9\uB418\uB294\uC9C0 \uC5C4\uACA9\uD788 \uD310\uB2E8\uD558\uACE0, \uC5B4\uB290 \uC0AC\uC720\uC5D0\uB3C4 \uD574\uB2F9\uB418\uC9C0 \uC54A\uB294\uB2E4\uBA74 \uBD88\uAD6C\uC18D \uC0C1\uD0DC\uC5D0\uC11C \uD615\uC0AC\uC808\uCC28\uB97C \uC9C4\uD589\uD558\uB294 \uAC83\uC774 \uBC14\uB78C\uC9C1\uD568. \uC2EC\uC815\uB9CC\uC73C\uB85C \uAD6C\uC18D\uC758 \uD544\uC694\uC131\uC744 \uC778\uC815\uD560 \uACBD\uC6B0, \uBB34\uC8C4\uCD94\uC815\uC758 \uC6D0\uCE59\uC774\uB098 \uBE44\uB840\uC131 \uC6D0\uCE59 \uB4F1\uC5D0\uC11C \uBB38\uC81C\uAC00 \uBD88\uAC70\uC9C8 \uC218\uB3C4 \uC788\uC74C\u2026",
