  "text" : "\uD2B8\uB77C\uC774\uD0C4 \uC18C\uC7AC\uC758 \uC6D0 \uC81C\uC870\uC0AC\uC870\uCC28 \uD574\uB2F9 \uC18C\uC7AC\uAC00 \uC804\uC790\uB808\uC778\uC9C0 \uC0AC\uC6A9\uC2DC \uC548\uC804\uD558\uB2E4\uACE0 \uBC1D\uD78C \uBC14 \uC5C6\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uC804\uC790\uB808\uC778\uC9C0 \uC0AC\uC6A9\uC2DC\uC5D0\uB3C4 \uD658\uACBD\uD638\uB974\uBAAC\uC774 \uB098\uC624\uC9C0 \uC54A\uB294\uB2E4\uACE0 \uD64D\uBCF4\uD558\uB294 \uAC83\uC740 \uD5C8\uC704\u00B7\uACFC\uC7A5 \uAD11\uACE0\uB77C\uACE0 \uD310\uB2E8.\n\n\uC7AC\uBBF8\uC788\uB294 \uAC83\uC740, \uC800 \uC774\uC758 \uC81C\uAE30\uB97C \uAE00\uB77C\uC2A4\uB77D\uC758 \uC0BC\uAD11\uC720\uB9AC\uAC00 \uD568\u2026",
