  "text" : "\uACF5\uC815\uAC70\uB798\uC704\uC6D0\uD68C\uAC00 \uC774\uB97C \uBC1B\uC544\uB4E4\uC5EC \uBAA8 \uC5C5\uCCB4\uC5D0 \uB300\uD574 \uACBD\uACE0 \uC870\uCE58. \uD2B8\uB77C\uC774\uD0C4 \uC18C\uC7AC \uC6A9\uAE30 \uC81C\uC870\uC5C5\uCCB4\uB4E4\uC774 \uD658\uACBD\uD638\uB974\uBAAC\uC778 \uBE44\uC2A4\uD398\uB180A(\uC774\uD558 BPA) \uC774\uC678\uC758 \uB2E4\uB978 \uD658\uACBD\uD638\uB974\uBAAC\uC774 \uAC80\uCD9C\uB420 \uAC00\uB2A5\uC131\uC774 \uC788\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0, \uB9C8\uCE58 \uBAA8\uB4E0 \uD658\uACBD\uD638\uB974\uBAAC\uC774 \uAC80\uCD9C\uB418\uC9C0 \uC54A\uB294 \uC81C\uD488\uC778 \uAC83\uCC98\uB7FC \uD64D\uBCF4\uD558\uC600\uACE0",
