  "text" : "\uBC18\uB0A8\uC131\uC8FC\uC758\uAC00 \uC544\uB2CC \uD398\uBBF8\uB2C8\uC998\uC744 \uBC14\uB85C \uC54C\uC544\uC57C \uD558\uB294 \uC774\uC720\uC5D0 \uB300\uD574 \uC124\uBA85\uD558\uACE0 \uC788\uC74C. \uC720\uB825\uC9C0\uC758 \uAE30\uC0AC\uAC00 \uC544\uB2CC \uB300\uD559 \uB0B4 \uC2E0\uBB38\uC758 \uAE30\uC0AC\uC774\uC9C0\uB9CC, \uCDA9\uBD84\uD788 \uC77D\uC5B4 \uBCFC \uB9CC\uD558\uB2E4\uACE0 \uC0DD\uAC01.\n\n\uC544\uB294 \uC0AC\uB78C\uC774\uC57C \uB2F9\uC5F0\uD55C \uB0B4\uC6A9\uC774\uB77C \uB9D0\uC744 \uC548\uD558\uACE0, \uBAA8\uB974\uB294 \uC0AC\uB78C\uC740 \uBAA8\uB974\uB2C8\uAE4C \uB9D0\uC744 \uC548\uD558\uACE0 \uBB50 \uADF8\uB7F0\u2026",
