  "text" : "\uD398\uBBF8\uB2C8\uC998\uC5D0 \uB300\uD574 \u2018\uC798 \uBAA8\uB978\uB2E4\u2019\uACE0 \uB2F5\uD588\uACE0, \uADF8 \uC911 12.3%(13\uBA85)\uAC00 \"\uD398\uBBF8\uB2C8\uC998\uC774 \uB0A8\uB140\uB97C \uAD6C\uBD84\uC9D3\uACE0 \uB0A8\uC790\uC5D0 \uB300\uD56D\uD558\uB294 \uBC18\uB0A8\uC131\uC8FC\uC758\uC758 \uB290\uB08C\uC774 \uC788\uB2E4\"\uB294 \uC774\uC720\uB85C \uD398\uBBF8\uB2C8\uC998\uC5D0 \uB300\uD55C \uAC70\uBD80\uAC10\uC744 \uD45C\uD588\uB2E4\uACE0 \uD568. \uADF8\uB798\uC11C \uD574\uB2F9 \uAE30\uC0AC\uB294 \uD398\uBBF8\uB2C8\uC998\uC5D0 \uB300\uD55C \uC624\uD574\uC640 \uC65C\uACE1\uC744 \uC9C0\uC801\uD558\uACE0",
