  "text" : "\uD1A0\uB80C\uD2B8 \uACF5\uC720 \uC0AC\uC774\uD2B8 \uB4F1\uC5D0\uC11C\uB294 \uBCF4\uD1B5 \uB0A8\uC131 \uC774\uC6A9\uC790\uB4E4\uC774 \uB4DD\uC138\uB97C \uD558\uAE30 \uB9C8\uB828\uC778\uB370, \uADF8\uB7F0 \uACF3\uC758 \uC720\uBA38\uAC8C\uC2DC\uD310 \uB4F1\uC5D0 \uB4E4\uC5B4\uAC00\uBCF4\uBA74 \uC5EC\uC131\uD610\uC624 \uAC8C\uC2DC\uBB3C\uB4E4\uC774 \uC2ED\uC911\uD314\uAD6C \uC788\uC74C. \uAC70\uAE30\uC5D0 \uC800\uB7F0 \uCEA1\uCCD0\uBCF8\uB4E4\uC774 \uC62C\uB77C\uC624\uBA74\uC11C \uB098\uB294\uD398\uBBF8\uB2C8\uC2A4\uD2B8\uB2E4 \uD0DC\uADF8\uB97C \uB514\uC2A4\uD558\uACE0, \uC800\uAC78 \uD398\uBBF8\uB2C8\uC998 \uC6B4\uB3D9\uC774\uB77C \uD3C4\uD6FC\uD55C\uB2E4\uB2C8\uAE4C\u2026",
