  "text" : "\uB124\uAC00 \uBCF8 \uD55C\uC815\uB41C \uC0AC\uB840\uB97C \uAC00\uC9C0\uACE0 '\uD55C\uAD6D \uC5EC\uC790\uB294~' \uC774\uB77C\uACE0 \uD310\uB2E8\uD558\uAE30\uC5D0\uB294 \uC624\uB958\uAC00 \uB9CE\uC9C0 \uC54A\uACA0\uC5B4?\" \uC2DD\uC73C\uB85C \uC124\uB4DD\uC744 \uD55C\uB2E4\uACE0 \uD588\uB294\uB370, \uB2E4\uD589\uD788\uB3C4 \uC774\uD574\uD558\uB294 \uB208\uCE58\uC600\uC74C.. \uC774 \uD559\uC0DD\uC774 \uC815\uB9D0\uB85C \uC774\uD574\uB97C \uD55C\uAC74\uC9C0, \uC544\uB2C8\uBA74 \uC5F0\uAE30\uB97C \uD558\uB294 \uAC83\uC778\uC9C0\uB294 \uBAB0\uB77C\uB3C4 \uC801\uC5B4\uB3C4 \uB0B4 \uC55E\uC5D0\uC11C\uB294 \uB354\uC774\uC0C1",
