  "text" : "\uD55C\uAD6D\uC5EC\uC790\uAC00 \uADF8\uB807\uB2E4\uB294 \uAC83\uC740 \uBB34\uB9AC\uD55C \uC778\uC2DD \uC544\uB2D0\uAE4C? \uB2F9\uC7A5 \uC9C0\uAE08\uC0AC\uADC0\uACE0 \uC788\uB294 \uC5EC\uC790\uCE5C\uAD6C\uB3C4 \uB108\uAC00 \uB9D0\uD558\uB294 '\uADF8\uB7F0 \uD55C\uAD6D\uC5EC\uC790'\uB294 \uC544\uB2C8\uC796\uC544. \uADF8\uAC74 \uC5B4\uB514\uAE4C\uC9C0\uB098 \uC5EC\uC790\uB77C\uB294 '\uC131'\uC758 \uD2B9\uC131\uC774 \uC544\uB2C8\uB77C \uAC1C\uAC1C\uC778\uC758 \uD2B9\uC131 \uCC28\uC774\uC77C \uBFD0\uC774\uC9C0. \uADF8\uB7F0 \uC0AC\uB78C\uB3C4 \uC788\uB294\uAC70\uACE0, \uC548\uADF8\uB7F0 \uC0AC\uB78C\uB3C4 \uC788\uB294 \uAC83\uC778\uB370",
