  "text" : "\uB098\uB234\uB294\uB370, \uCC98\uC74C\uC5D0\uB294 \uD754\uD788 \uC811\uD560 \uC218 \uC788\uB294- \uC778\uD130\uB137\uC5D0\uC11C \uBD24\uB2E4\uB294 \uB4F1\uC758 \uC774\uC57C\uAE30\uAC00 \uB098\uC624\uB2E4\uAC00 \uACB0\uAD6D\uC740 \"\uC9C1\uC804 \uC5F0\uC560\uC5D0\uC11C, \uC5EC\uC790\uCE5C\uAD6C\uAC00 \uB2E4\uB978 \uB0A8\uC790\uC640 \uC790\uB294 \uC0AC\uC774\uC778 \uAC83\uC744 \uC54C\uAC8C \uB418\uC5B4 \uD5E4\uC5B4\uC9C4 \uC774\uD6C4\uB85C-\" \uB77C\uACE0 \uD138\uC5B4\uB193\uB354\uB77C\uACE0. \uADF8\uB798\uC11C \uC6B0\uC120\uC740 \uC704\uB85C\uB97C \uD574\uC900 \uB4A4\uC5D0 \"\uADF8\uB807\uB2E4\uACE0 \uD574\uC11C \uBAA8\uB4E0",
