  "text" : "\uB611\uAC19\uC774 \uBB3C\uC5B4\uBD10\uB3C4 \uAC70\uC758 \uB3D9\uC77C\uD55C \uBC18\uC751\uC774 \uB098\uC628\uB2E4\uB294 \uAC83\uC774\uC5C8\uB2E4. \uD655\uB300\uC640 \uC7AC\uC0DD\uC0B0\uC744 \uD1B5\uD55C \uC77C\uBC18\uD654. \uB2E4\uB9CC \uB0A8\uC790\uC758 \uACBD\uC6B0\uC5D0\uB294 \"\uC790\uAE30 \uC5B4\uBA38\uB2C8\uAC00 \uADF8\uB7EC\uACE0 \uB2E4\uB2C8\uC154\uC11C\u2026\" \uB958\uC758 \uB300\uB2F5\uC744 \uD558\uB294 \uACBD\uC6B0\uB97C \uC544\uC9C1\uAE4C\uC9C0\uB294 \uBABB \uACAA\uC5B4\uBD24\uB294\uB370, \uB0B4 \uB098\uB984\uB300\uB85C\uB294 '\uB0A8\uB4E4\uC5D0\uAC8C \uC595\uBCF4\uC774\uAE30 \uC2EB\uC5B4\uC11C' \uB77C\uACE0 \uCD94\uCE21 \uC911",
