  "text" : "\uADF8 \uBD84\uC758 \uC815\uC758\uC5D0 \uC758\uD558\uBA74, \uAC8C\uC774\uAC00 \uB418\uAE30 \uC704\uD574\uC11C\uB294 \uB3D9\uC131\uC560 \uC678\uC5D0\uB3C4 \uB9CE\uC740 \uAC83\uB4E4\uC744 \uAC16\uCDB0\uC57C\uB9CC \uD558\uB294 \uAC83 \uAC19\uB2E4. \uC885\uC774\uCEF5\uB3C4 \uC4F0\uBA74 \uC548\uB418\uACE0, \uC131\uAE30\uB3C4 \uAE68\uB057\uD558\uAC8C \uC53B\uC5B4\uC57C \uD558\uACE0, ~\uB3C4 \uD574\uC57C \uD558\uACE0, ~\uB3C4 \uC54C\uC544\uC57C \uD558\uACE0.. \uADF8 \uAE30\uC900\uC5D0 \uBD80\uD569\uB418\uC9C0 \uC54A\uB294\uB2E4\uBA74 \uAC8C\uC774\uAC00 \uC544\uB2C8\uB77C\uACE0 \uBD80\uC815\uB2F9\uD560 \uB4EF..",
