  "text" : "\"\uB3D9\uC131\uC560\uC790\uB77C\uACE0 \uB2E4 ~\uD558\uC9C4 \uC54A\uC544. \uADF8\uAC74 \uB3D9\uC131\uC560\uC640\uB294 \uC0C1\uAD00 \uC5C6\uB294, \uC5B4\uB514\uAE4C\uC9C0\uB098 \uAC01\uC790\uC758 \uAC1C\uC131 \uCC28\uC774\uC77C \uBFD0\uC774\uC9C0.\" \uB77C\uACE0 \uC815\uC815\uD574 \uC8FC\uC5C8\uB2E4. \uADF8\uB798\uC11C \uB098\uB294 \uB3D9\uC131\uC560\uC790\uB4E4\uC740 '\uAC8C\uC774\uB294 ~\uD558\uB2E4' \uC2DD\uC758 \uC77C\uBC18\uD654\uB97C \uAC70\uBD80\uD55C\uB2E4\uACE0 \uC0DD\uAC01\uD558\uACE0 \uC788\uC5C8\uB294\uB370, \uC81C\uC774\uC2A8\uBC15\uC744 \uBCF4\uBA74 \uADF8\uAC83\uB3C4 \uB2E4 \uAC1C\uC778\uCC28\uC778 \uB4EF.",
