  "text" : "\uC811\uD560 \uB54C\uB9C8\uB2E4 \uC6B0\uB824\uB3C4 \uB418\uACE0, \uC880 \uB9CE\uC774 \uB2F9\uD669\uC2A4\uB7FD\uB2E4. \uD2B9\uD788 \uC800 \uBD84\uC740 \uD3C9\uC18C\uC5D0\uB3C4 '\uAC8C\uC774\uB294 ~\uD558\uB2E4' \uB77C\uACE0 \uC77C\uBC18\uD654 \uD558\uB294 \uBC1C\uC5B8\uC744 \uB9CE\uC774 \uD558\uC2DC\uB294\uB370, \uADF8\uAC8C \uC5BC\uB9C8\uB098 \uC704\uD5D8\uD55C \uBC1C\uC5B8\uC778\uC9C0\uC5D0 \uB300\uD55C \uC778\uC2DD\uC774 \uC5C6\uB294 \uAC83 \uAC19\uAE30\uB3C4 \uD558\uACE0.. \uB3D9\uC131\uC560\uC790\uC758 \uC9C0\uD45C\uB294 '\uB3D9\uC131\uC560\uC758 \uC5EC\uBD80'\uAC00 \uB418\uC5B4\uC57C \uD558\uB294\uB370",
