  "text" : "\uAC70\uAE30\uC5D0 \uCD94\uAC00\uD55C \"\uAC8C\uC774\uB294 \uC885\uC774\uCEF5 \uC548\uC368\uC694.\" \uB77C\uB294 \uB9D0\uC774 \uC815\uB9D0 \uB9D8\uC5D0 \uC548\uB4E4\uB354\uB77C. \uADF8\uB807\uB2E4\uBA74 \uAC8C\uC774\uC758 \uC9C0\uD45C \uC911 \uD558\uB098\uAC00 '\uC885\uC774\uCEF5 \uC0AC\uC6A9 \uC5EC\uBD80'\uAC00 \uB418\uC5B4\uC57C \uD558\uB098?\n\n'\uB098\uB294 \uC790\uC2E0\uC774 \uC18D\uD55C \uC9D1\uB2E8\uC758 \uC815\uD655\uD55C \uD45C\uBCF8\uC774\uBA70, \uB0B4\uAC00 \uADF8 \uC9D1\uB2E8\uC758 \uBAA9\uC18C\uB9AC\uB97C \uB300\uBCC0\uD55C\uB2E4' \uC2DD\uC73C\uB85C \uB9D0\uD558\uB294 \uC0AC\uB78C\uB4E4\uC744",
