  "text" : "\uB098\uB294 \uB0A8\uB4E4\uC774 '\uAC8C\uC774\uB294 ~\uD558\uB2E4.' \uC2DD\uC758 \uC120\uC785\uACAC\uB9CC \uAC00\uC9C0\uACE0 \uB0B4 \uC131\uC801 \uCDE8\uD5A5\uC744 \uC81C\uBA4B\uB300\uB85C \uD310\uB2E8\uD558\uB294 \uAC83\uC774 \uC2EB\uACE0, \uAC70\uAE30\uC5D0 \uC228\uC5B4\uC788\uB294 '\uB0A8\uC790\uB294 \uAE54\uB054\uD558\uC9C0 \uC54A\uB2E4'\uB294 \uCF54\uB4DC\uAC00 \uC2EB\uC5C8\uB2E4\uACE0 \uB9D0\uD588\uB294\uB370, \uADF8\uAC78 \uAD73\uC774 '\uB0B4\uBA74\uC758 \uAC8C\uC774\uD3EC\uBE44\uC998 \uBC1C\uD604'\uC774\uB77C\uACE0 \uD574\uC11D\uD558\uB294 \uAC83\uAE4C\uC9C0\uB294 \uC774\uD574\uB97C \uD558\uACA0\uB294\uB370",
