  "text" : "'\uB098\uB294\uD398\uBBF8\uB2C8\uC2A4\uD2B8\uC785\uB2C8\uB2E4' \uC6B4\uB3D9\uC5D0 \uB300\uD574 \uC11C\uB294 \uAE0D\uC815\uC801\uC73C\uB85C \uC0DD\uAC01\uD558\uC9C0\uB9CC\u2026 #\uB098\uB294\uD398\uBBF8\uB2C8\uC2A4\uD2B8\uC785\uB2C8\uB2E4 \uD0DC\uADF8\uB97C \uB2EC\uACE0 \uAE00\uC744 \uC4F0\uB294 \uBD84\uB4E4 \uC911\uC758 \uC77C\uBD80\uB294 \uADF8 \uD0DC\uADF8\uB97C #\uB098\uB294\uC1FC\uBE44\uB2C8\uC2A4\uD2B8\uC785\uB2C8\uB2E4 \uB85C \uBC14\uAFC0 \uD544\uC694\uAC00 \uC788\uB2E4\uB294 \uC0DD\uAC01\uC774 \uB4E0\uB2E4. \uD398\uBBF8\uB2C8\uC998\uC73C\uB85C \uD3EC\uC7A5\uB41C \uC1FC\uBE44\uB2C8\uC998\uC740 \uD398\uBBF8\uB2C8\uC998\uC758 \uAC00\uC7A5 \uD070 \uC801.",
