  "text" : "\uBD80\uC815\uC801\uC778 \uAC10\uC815\uC744 \uB290\uAF08\uACE0, \uC774\uB7EC\uD55C \uAC10\uC815\uC740 \uB0B4\uAC8C \uB3D9\uC131\uC560 \uC778\uAD8C\uC6B4\uB3D9\uAC00\uB97C \uD3EC\uD568\uD55C \uD398\uBBF8\uB2C8\uC2A4\uD2B8\uC5D0 \uB300\uD574 \uC0C9\uC548\uACBD\uC744 \uB07C\uACE0 \uBCF4\uAC8C \uB9CC\uB4EC\uACFC \uB3D9\uC2DC\uC5D0 \uB098\uC758 \uC5C5\uBB34\uC5D0\uAE4C\uC9C0 \uC545\uC601\uD5A5\uC744 \uB07C\uCE58\uAE30 \uC2DC\uC791\uD588\uB2E4.\n\n\uC774\uC5D0 \uB300\uD574 '\uC885\uC774\uCEF5'\uC744 \uBE4C\uC5B4 \uD2B8\uC704\uD130\uC5D0 \uB9D0\uC744 \uAEBC\uB0C8\uB2E4\uAC00, \uD3EC\uAE30\uD558\uACE0 \uD2B8\uC704\uD130\uB97C \uB5A0\uB098\uAC8C \uB428.",
