  "text" : "\uC774\uC131\uC801\uC73C\uB85C\uB294 '\uC800\uB4E4\uC740 \uD398\uBBF8\uB2C8\uC2A4\uD2B8\uAC00 \uC544\uB2C8\uB77C \uC1FC\uBE44\uB2C8\uC2A4\uD2B8\uC57C.' \uB77C\uACE0 \uD310\uB2E8\uD558\uC9C0\uB9CC, \uB098\uB3C4 \uB0A8\uC790\uC774\uB2E4\uBCF4\uB2C8 \uD0D0\uB77C\uC5D0 \uC9C0\uC18D\uC801\uC73C\uB85C \uB178\uCD9C\uB418\uB294 '\uB0A8\uC790\uB294 \uB2E4 \uB098\uBE60.', '\uB0A8\uC790\uB294 \uB2E4 \uB354\uB7EC\uC6CC.', '\uBB50\uB4E0\uC9C0 \uB0A8\uC790\uAC00 \uBB38\uC81C\uC57C.' \uC2DD\uC758 \uB0A8\uC131 \uD610\uC624\uC640 \uBE44\uD558\uC801\uC778 \uC694\uC18C\uAC00 \uC11E\uC778 \uBC1C\uC5B8\uB4E4\uC5D0 \uB300\uD574\uC11C",
