  "text" : "\uADF8\uB3D9\uC548 \uC65C \uC548\uBCF4\uC600\uB0D0\uACE0 \uBB3C\uC5B4\uB4E4 \uBCF4\uC2DC\uB294\uB370\u2026\n\n\u3131. \uB2E4 \uC8FD\uC5B4\uAC00\uB2E4\uAC00 \uC0B4\uC544\uB098\uC11C\n\u3134. \uD574\uC678 \uC5F0\uC218 \uB4F1\uC73C\uB85C \uC778\uD574 \uB108\uBB34 \uBC14\uBE60\uC11C\n\u3137. \uC5BC\uC9F1 \uCD9C\uC2E0 \uC1FC\uD551\uBAB0 CEO\uC640\uC758 \uC5F0\uC560\uC5D0 \uC9D1\uC911\uD558\uB290\uB77C\n\u3139. \uD2B8\uC704\uD130\uC5D0 \uC885\uC885 \uBCF4\uC774\uB294 \uB0A8\uC131\uD610\uC624 \uB4F1\uC758 \uAE30\uC870\uC5D0 \uC9C8\uB824\uC11C\n\u3141. \uB3C4 \uB2E6\uB290\uB77C\n\n\uBCF5\uC218\uC815\uB2F5 \uC778\uC815.",
